import { createRouter, createWebHashHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'
import { mapState } from 'vuex'

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/signup',
    name: 'signup',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/SignupView.vue')
  },
  {
    path: '/login',
    name: 'login',
    component: () => import('../views/LoginView.vue')
  },
  {
    path: '/publication',
    name: 'publication',
    component: () => import('../views/PublicationView.vue')
  },
  {
    path: '/profil',
    name: 'profil',
    component: () => import('../views/ProfilDetail.vue')
  },
  {
    path: '/profil/modification',
    name: 'profil-modification',
    component: () => import('../views/ProfilModif.vue')
  },
  {
    path: '/profil/:id',
    name: 'profil-id',
    component: () => import('../views/ProfilOther.vue')
  }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
